INSERT INTO `jbl-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/JBL-Kopfhörer/JBL Live  500BT.webp;', 'JBL Live  500BT', 'https://www.amazon.de/Live-500-Kabelloser-Kopfh%C3%B6rer-Wei%C3%9F-gr%C3%BCn/dp/B07PFXNBXH/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3CBAJAXVXQK04&keywords=JBL+Live+500BT&qid=1667230679&qu=eyJxc2MiOiIzLjM0IiwicXNhIjoiMy42NyIsInFzcCI6IjMuMTAifQ%3D%3D&sprefix=%2Caps%2C81&sr=8-3', '88,33', 4.5, 189, 2, 'white;JBL;Erwachsener;-;Bluetooth;Ohrumschließend;Kabelgebunden, Kabellos;JBL SOUND SIGNATEN: 50-mm-Treiber die JBL Soundsignale, die sich an den berühmtesten Orten auf der ganzen Welt befindet.|Amazon Alexa: Spielen Sie Ihre Lieblings-Playlist, schreiben Sie Ihren Freund, überprüfen Sie die Zeit und vieles mehr, indem Sie den Ohrmuschel berühren, um Amazon Alexa zu aktivieren. Verwenden Sie die neue JBL App, um Ihren Sprachassistenten einfach einzustellen.|Umgebungen und TALKTHRU: Musik nicht stoppen lassen! Bleiben Sie in Kontakt mit Ihrer Umgebung, während Sie Ihre Songs hören. Die Ambient Aware Taste steigert den Umgebungston und ermöglicht es Ihnen, das zu hören, was um Sie herum passiert. Der TalkThru-Modus senkt den Musikpegel, sodass Sie mit Ihren Freunden sprechen können, ohne die Bluetooth-Kopfhörer zu entfernen.|Akku bis zu 30 Stunden: Machen Sie einen ganzen Tag lang oder mehr springen und genießen Sie eine superschnelle Aufladung, wenn nicht genug ist. Eine schnelle Aufladung von 15 Minuten ermöglicht es Ihnen, den Spaß für weitere 2 Stunden zu verlängern.|Hande Anrufe: Bleiben Sie mit Ihrer Welt in Kontakt mit Anrufen mit den Tasten auf dem Ohrmuschel. Wenn der Akku flach ist, schließen Sie einfach das Audiokabel an und Sie können weiter hören und chatten. Enthaltene Komponenten: Kopfhörer, Ladekabel, Aux-Kabel');
INSERT INTO `jbl-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/JBL-Kopfhörer/JBL Live 660NC kabelloser Over-Ear Bluetooth-Kopfhörer.webp;', 'JBL Live 660NC kabelloser Over-Ear Bluetooth-Kopfhörer', 'https://www.amazon.de/JBL-kabelloser-Over-Ear-Bluetooth-Kopfh%C3%B6rer-Schwarz/dp/B08VDMK1V2/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3PORYHS8ERCY3&keywords=JBL+Live+660NC+kabelloser+Over-Ear+Bluetooth-Kopfh%C3%B6rer&qid=1667230685&qu=eyJxc2MiOiIxLjI2IiwicXNhIjoiMS4zMSIsInFzcCI6IjEuNTkifQ%3D%3D&sprefix=jbl+live+660nc+ka%2Caps%2C166&sr=8-3', '116,16', 4.4, 576, 3, 'black;JBL;Erwachsener;265 g;Bluetooth;Ohrumschließend;Kabellos;Der kabellose Live 660NC Bluetooth-Kopfhörer mit JBL Signature Sound blendet dank adaptivem Noise-Cancelling den Lärm aus - für ein intensives Hörerlebnis ohne Störgeräusche|Nichts mehr verpassen: Mit Ambient Aware und TalkThru Technologie ist Musik hören, mit Freunden reden und die Umgebung wahrnehmen gleichzeitig möglich - mit nur einem Knopfdruck|Der Sprachassistent kann auf verschiedene Weise ganz bequem aktiviert werden - entweder mit der Stimme, durch ein Tippen auf die Ohrmuschel oder mit der JBL App|Der Over-Ear Kopfhörer bietet bis zu 50 Stunden Musikgenuss ohne ANC und 40 Stunden mit ANC sowie 4 Stunden Akkulaufzeit mit nur 10-minütiger Aufladung / Mit abnehmbarem Audiokabel|Lieferumfang: 1 x JBL Live 660NC kabelloser Kopfhörer mit ANC in Schwarz / 1 x Audiokabel, 1 x Typ-C-Ladekabel, 1 x Transportbeutel, 1 x Garantie/Warnung, 1 x Kurzanleitung/Sicherheitsdatenblatt|Hinweis: Um die Kopfhörer zurückzusetzen, müssen Sie die Tasten Lautstärke + und Lautstärke - fünf Sekunden lang gedrückt halten. Es kann erforderlich sein, das Gerät aus den Bluetooth-Einstellungen zu entfernen und zu vergessen');
