INSERT INTO `jbl-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/JBL-Kopfhörer/JBL T450BT.webp;', 'JBL T450BT', 'https://www.amazon.de/JBL-Bluetooth-Kopfh%C3%B6rer-Kabellose-integriertem-Akku-Ladung-Schwarz/dp/B01M6WNWR6/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1BBTVVVRRZE6C&keywords=JBL+T450BT&qid=1667230735&qu=eyJxc2MiOiIyLjk5IiwicXNhIjoiMy4yNCIsInFzcCI6IjIuNzQifQ%3D%3D&sprefix=jbl+tune+125tws%2Caps%2C266&sr=8-3', '49,00', 4.4, 10301, 0, 'black;JBL;Erwachsener;145 g;Bluetooth;Ohraufliegend;Kabellos;Kräftiger Bass: Wireless Headphones mit JBL Pure Bass Sound - beeindruckende Soundqualität, welche sonst nur von großen Bühnen schallt und in Konzertsälen oder Aufnahmestudios erklingt|Stundenlanges Musikhören? Na klar! Der JBL On-Ear Bluetooth Kopfhörer versorgt seinen Besitzer mit bis zu 11 Stunden Lieblingsmusik pur - ohne Kabel, damit sich bloß nichts verknotet|"Hands free": Durch das eingebaute Mikrophon können Anrufe easy entgegengenommen werden - Telefonieren leicht gemacht, ohne das Smartphone überhaupt in die Hand nehmen zu müssen!|Sperrig? Nein danke! Durch das weiche, leichte Material liegt der Kopfhörer immer angenehm am Ohr an - sein faltbares Design ermöglicht ein einfaches Verstauen in Tasche oder Rucksack|Lieferumfang: 1 x T450 BT kabellose On-Ear-Kopfhörer in Schwarz von JBL / 1 x Ladekabel / Ohrmuschel mit Steuerungstasten / Warnhinweise / Sicherheitsmerkblatt / Kurzanleitung / Garantiekarte');
INSERT INTO `jbl-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (9, '../img/products/JBL-Kopfhörer/JBL Jr310.webp;', 'JBL Jr310', 'https://www.amazon.de/JBL-Jr310-Ear-Kinder-Kopfh%C3%B6rer-Hellblau-Rosa/dp/B08FB37439/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3DOTF8ZHF7ZZX&keywords=JBL+Jr310&qid=1667230741&qu=eyJxc2MiOiIyLjg0IiwicXNhIjoiMi4xOCIsInFzcCI6IjIuMDAifQ%3D%3D&sprefix=jbl+t450bt%2Caps%2C92&sr=8-2', '21,49', 4.7, 345, 0, 'blue;JBL;Kind;105 g;Bluetooth;Im Ohr;Kabellos;SafeSound: Die Musikkopfhörer begeistern mit erstklassigem JBL Sound und halten die Lautstärke unter 85 dB, um das sensible Kindergehör zu schützen - für ein sicheres Hörerlebnis|Das Headset eignet sich dank des integrierten Mikrofons ideal für den Fernunterricht oder um während der Pause mit den Schulfreunden zu reden|Die On-Ear Kopfhörer lassen sich dank des faltbaren Designs einfach mitnehmen - für ein fantastisches Musikerlebnis auf Reisen|Die bunten Headphones sind auf die kleinen Ohren von Kindern angepasst und sitzen dank der gepolsterten Kopfbügel und Ohrpolster federleicht auf dem Kopf - für noch mehr Spaß beim Musikhören|Lieferumfang: 1 x Jr310 On-Ear Kopfhörer von JBL in Hellblau-Rosa / Kabelgebundene Kopfhörer für Kinder / Inkl. Aufkleber-Set zum Verzieren und Garantieschein');
INSERT INTO `jbl-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/JBL-Kopfhörer/JBL Tune110BT.webp;', 'JBL Tune110BT', 'https://www.amazon.de/JBL-Kabelloser-Universeller-3-Tasten-Fernbedienung-Integriertem-Schwarz/dp/B075KPNDC8/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=XOYVSMJ9WYY5&keywords=JBL+Tune110BT&qid=1667230746&qu=eyJxc2MiOiIyLjM3IiwicXNhIjoiMi4xNSIsInFzcCI6IjEuODAifQ%3D%3D&sprefix=%2Caps%2C71&sr=8-3', '29,99', 4.2, 12826, 0, 'black;JBL;Erwachsener;16.2 g;Bluetooth;Im Ohr;Kabellos;Die Grab &amp; Go Lösung mit kraftvollem Klang: Mit JBL Pure Bass Sound sorgen die JBL Headphones für ein umwerfendes Klangerlebnis &amp; sind über Bluetooth ohne Kabel mit dem Smartphone verbindbar|In nur 2 Stunden ist der leistungsstarke Lithium-Ionen-Polymer Akku aufgeladen &amp; sorgt für bis zu 6 Stunden Musikgenuss am Stück / Kein Hin- &amp; Herschwingen der Ohrhörer dank eingebauten Magneten|Anrufe kabellos genießen: Die wireless Headphones lassen sich leicht über die universelle 3-Tasten-Fernbedienung mit integriertem Mikrofon steuern - die Musik einfach freihändig verwalten|Der leichte Begleiter für den alltäglichen Musikgenuss: Die ergonomischen Ohrstöpsel &amp; das leichte Design mit einem verwicklungsfreien, flachen Kabel sorgen für einen stundenlang bequemen Sitz|Lieferumfang: 1 x Tune 110 BT In Ear Kopfhörer in Schwarz von JBL / Ohrstöpsel in den Größen S, M &amp; L / 1 x ICON-Ladekabel / Garantiekarte / Kabellose Earphones mit bis zu 6 Stunden Akkulaufzeit|HINWEIS: Um die Werkseinstellungen zurückzusetzen, müssen Sie die drei Tasten am Kabel (Lautstärke +, Lautstärke - und Mikrofontaste) 20 Sekunden lang gedrückt halten oder bis das Licht in den Ohrhörern erlischt.');
