INSERT INTO `jbl-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (12, '../img/products/JBL-Kopfhörer/JBL T110.webp;', 'JBL T110', 'https://www.amazon.de/JBL-T110-Pure-Bass-in-Ear-Kopfh%C3%B6rer-Blau/dp/B06VWPVBMH/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3KSA7KGDM0EI4&keywords=JBL+T110&qid=1667230758&qu=eyJxc2MiOiIyLjU0IiwicXNhIjoiMS42OSIsInFzcCI6IjEuMzcifQ%3D%3D&sprefix=jbl+tune+500%2Caps%2C91&sr=8-3', '9,99', 4.3, 2602, 0, 'blue;JBL;Erwachsener;-;-;Im Ohr;Kabelgebunden;JBL Reiner Bass-Klang. Seit über 60 Jahren entwickelt JBL präzisen, beeindruckenden Klang für große Veranstaltungsorte auf der ganzen Welt. Diese Kopfhörer geben denselben JBL-Sound wieder und liefern sowohl tiefe als auch kraftvolle Bässe.|Fernbedienung mit 1 Taste und Mikrofon. Steuern Sie die Musikwiedergabe mit einer praktischen 1-Tasten-Fernbedienung. Eingehender Anruf? Beantworten Sie ihn unterwegs mit dem eingebauten Mikrofon|Langlebiges Flachkabel, das sich nicht verknotet.|Technische Daten: Stecker: 3,5&nbsp;mm. Dynamischer Treiber: 9&nbsp;mm. Frequenzbereich: 20&nbsp;Hz–20&nbsp;kHz.|Lieferumfang: 1 Paar T110 Kopfhörer. Ohrstöpsel (Größe S, M, L). Warnhinweis. Karte');
